declare var VueApi: any
import {Callback, Map} from "types";
export default class vue {
    constructor() {
    }

    public static getValueAsync(): Promise<Map<string,string>> {
        return VueApi.getValueAsync();
    }

    public static getValue(): Map<string,string> {
        return VueApi.getValue();
    }

    public static onClickAsync(async:boolean,obj:any,callback: Callback): Promise<void> {
        return VueApi.onClickAsync(async,obj,callback);
    }

    public static onClick(async:boolean,obj:any,callback: Callback): void {
        return  VueApi.onClickAsync(async,obj,callback);
    }

}